import React from "react";
import useGetSetlists from "../useGetSetlists"


function Setlist() {

    const setlists = useGetSetlists;

    return (
        <>



            <li key={setlist._id} className="list-group-item">

                Name: {setlist.name}  Gig Type: {setlist.gigtype}

            </li>


        </>
    )
}

export default Setlist;
